import React, { useEffect } from 'react';
import styled from 'styled-components';
import { useGlobalContext } from '../../context/globalContext';
import { InnerLayout } from '../../styles/Layouts';
import { rupiah } from '../../utils/icons';
import Chart from '../Chart/Chart';
import History from '../History/History';
import currencyFormat from 'currency-formatter';

function Dashboard() {
  const { totalExpenses, incomes, expenses, totalIncome, totalBalance, getIncomes, getExpenses } = useGlobalContext();

  useEffect(() => {
    getIncomes();
    getExpenses();
  }, []);

  const resCurMin = (res) => {
    const currency = Math.min(...res.map((item) => item.amount));
    return currencyFormat.format(currency, { code: 'IDR' });
  };

  const resCurMax = (res) => {
    const currency = Math.max(...res.map((item) => item.amount));
    return currencyFormat.format(currency, { code: 'IDR' });
  };

  return (
    <DashboardStyled>
      <InnerLayout>
        <h1>Semua Transaksi</h1>
        <div className="stats-con">
          <div className="dash-con">
            <div className="chart-con">
              <Chart />
              <div className="total-con">
                <div className="income">
                  <h2>Total Pemasukan</h2>
                  <p>{currencyFormat.format(totalIncome(), { code: 'IDR' })}</p>
                </div>
                <div className="expense">
                  <h2>Total Pengeluaran</h2>
                  <p>{currencyFormat.format(totalExpenses(), { code: 'IDR' })}</p>
                </div>
                <div className="balance">
                  <h2>Total Saldo</h2>
                  <p>{currencyFormat.format(totalBalance(), { code: 'IDR' })}</p>
                </div>
              </div>
            </div>
            <div className="history-con">
              <div className="left">
                <History />
                <h2 className="salary-title">
                  <span>Min</span>
                  <span>Pemasukan</span>
                  <span>Maks</span>
                </h2>
                <div className="salary-item">
                  <div className="min-cur">{resCurMin(incomes)}</div>
                  <div className="max-cur">{resCurMax(incomes)}</div>
                </div>
                <h2 className="salary-title">
                  Min <span>Pengeluaran</span>Maks
                </h2>
                <div className="salary-item">
                  <div className="min-cur">{resCurMin(expenses)}</div>
                  <div className="max-cur">{resCurMax(expenses)}</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </InnerLayout>
    </DashboardStyled>
  );
}

const DashboardStyled = styled.div`
.stats-con {
  display: flex;
  gap: 5rem;
  flex-direction: column;
  .salary-title {
    margin: 10px 0;
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  .salary-item {
    background: #fcf6f9;
    border: 2px solid #ffffff;
    box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
    padding: 1rem;
    border-radius: 20px;
    display: flex;
    justify-content: space-between;
    align-items: center;
  }
  .min-cur {
    text-align: left;
  }
  .max-cur {
    text-align: right;
  }
  .dash-con {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    gap: 2rem;
  }
`;

export default Dashboard;
